var title_f11_42_11940="Glucocorticoid effects on gene expression";
var content_f11_42_11940=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F59432&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F59432&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 519px\">",
"   <div class=\"ttl\">",
"    Glucocorticoid effects on gene expression",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 499px; height: 373px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Glucocorticoids may regulate gene expression in several ways. Glucocorticoids enter the cell to bind to glucocorticoid receptors in the cytoplasm. The resultant GR&nbsp;homodimers translocate to the nucleus. GR homodimers then bind to glucocorticoid-response elements (GRE) in the promoter region of steroid-sensitive genes, which may encode anti-inflammatory proteins. Less commonly, GR homodimers interact with negative GREs to suppress genes, particularly those linked to side effects of glucocorticoids. Nuclear GR also interact with coactivator molecules, such as CREB-binding protein (CBP), which is activated by proinflammatory transcription factors, such as nuclear factor-kB (NF-kB), thus switching off the inflammatory genes that are activated by these transcription factors.",
"    <div class=\"footnotes\">",
"     SLPI: secretory leukoprotease inhibitor; MKP-1: mitogen-activated kinase phosphatase-1; IkB-&alpha;: inhibitor of NF-kB; GILZ: glucocorticoid-induced leucine zipper protein; POMC: pro-opiomelanocortin; CRF: corticotrophin-releasing factor; GR: glucocorticoid receptor.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
