"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?11/42/11942/abstract/2\">",
"      Simon MS, Cody RL. Cellulitis after axillary lymph node dissection for carcinoma of the breast. Am J Med 1992; 93:543.",
