"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?11/42/11945/abstract/2\">",
"      Davis K Jr, Campbell RS, Johannigman JA, et al. Changes in respiratory mechanics after tracheostomy. Arch Surg 1999; 134:59.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?11/42/11945/abstract/3\">",
"      Moscovici da Cruz V, Demarzo SE, Sobrinho JB, et al. Effects of tracheotomy on respiratory mechanics in spontaneously breathing patients. Eur Respir J 2002; 20:112.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?11/42/11945/abstract/4\">",
"      Lin MC, Huang CC, Yang CT, et al. Pulmonary mechanics in patients with prolonged mechanical ventilation requiring tracheostomy. Anaesth Intensive Care 1999; 27:581.",
"     </a>",
"    </li>",
