var title_f11_42_11948="Egs pathophys epilepsy";
var content_f11_42_11948=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F75633&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F75633&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Examples of specific pathophysiological defects leading to epilepsy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Level of brain function",
"       </td>",
"       <td class=\"subtitle1\">",
"        Condition",
"       </td>",
"       <td class=\"subtitle1\">",
"        Pathophysiologic mechanism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neuronal network",
"       </td>",
"       <td>",
"        Cerebral dysgenesis, post-traumatic scar, mesial temporal sclerosis (in TLE)",
"       </td>",
"       <td>",
"        Altered neuronal circuits: Formation of aberrant excitatory connections (\"sprouting\")",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neuron structure",
"       </td>",
"       <td>",
"        Down syndrome and possibly other syndromes with mental retardation and seizures",
"       </td>",
"       <td>",
"        Abnormal structure of dendrites and dendritic spines: Altered current flow in neuron",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neurotransmitter synthesis",
"       </td>",
"       <td>",
"        Pyridoxine (vitamin B",
"        <sub>",
"         6",
"        </sub>",
"        ) dependency",
"       </td>",
"       <td>",
"        Decreased GABA synthesis: B",
"        <sub>",
"         6",
"        </sub>",
"        , a co-factor for GAD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neurotransmitter receptors: Inhibitory",
"       </td>",
"       <td>",
"        Angelman syndrome, juvenile myoclonic epilepsy",
"       </td>",
"       <td>",
"        Abnormal GABA receptor subunit(s)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neurotransmitter receptors: Excitatory",
"       </td>",
"       <td>",
"        Non-ketotic hyperglycinemia",
"       </td>",
"       <td>",
"        Excess glycine leads to activation of NMDA receptors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Synapse development",
"       </td>",
"       <td>",
"        Neonatal seizures",
"       </td>",
"       <td>",
"        Many possible mechanisms, including the depolarizing action of GABA early in development",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ion channels (\"channelopathies\")",
"       </td>",
"       <td>",
"        Benign familial neonatal convulsions",
"       </td>",
"       <td>",
"        Potassium channel mutations: Impaired repolarization",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     TLE: temporal lobe epilepsy; GABA: &Gamma;-aminobutyric acid; GAD: glutamic acid decarboxylase.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Rho, JM, Stafstrom, CE. Neurophysiology of epilepsy. In: Pediatric Neurology: Principles and Practice, 4th ed, Swaiman, KF, Ashwal, S, Ferreiro, DM (Eds). Mosby Elsevier. Philadelphia 2006. Copyright &copy;2006.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
